import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./home";
import Category from "./catagory";
import Cart from "./cart";
import ProductList from "./product_list";
import Blog from "./blog";
import SingleProduct from "./single-product";
import SingleBlog from "./single-blog";
import Login from './login';
import Saved from './elements';
import About from './about';
import Confirmation from './confirmation';
import CheckOut from './checkout';
import Contact from './contact';
import SignUp from './signup'
import Women from './Components/women'
import Men from './Components/men'
import Electronics from './Components/Electronics'
import  Fashion from './Components/fashion'
import  Sports from './Components/sports'
import Search from './Components/search'


function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/category" exact component={Category} />
          <Route path="/women" exact component={Women} />
          <Route path="/:product" exact component={Search} />
          <Route path="/men" exact component={Men} />
          <Route path="/electronics" exact component={Electronics} />
          <Route path="/fashion" exact component={Fashion} />
          <Route path="/sports" exact component={Sports} />

          <Route path="/product_list" exact component={ProductList} />
          <Route path="/single_product/:id" exact component={SingleProduct} />
          <Route path="/single/:id" exact component={SingleBlog} />
          <Route path="/blog" exact component={Blog} />
          <Route path="/login" exact component={Login} />
          <Route path="/signup" exact component={SignUp} />
          <Route path="/cart" exact component={Cart} />
          <Route path="/saved" exact component={Saved} />
          <Route path="/about" exact component={About} />
          <Route path="/confirmation" exact component={Confirmation} />
          <Route path="/checkout" exact component={CheckOut} />
          <Route path="/contact" exact component={Contact} />



        </Switch>
      </Router>
    </div>
  );
}

export default App;
